import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
//import IconButton from '@material-ui/core/IconButton';
import logo from '../../assets/logos/comduit-logo.png';
import { Grid } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },

  logo: {
    flexGrow: 1,
    width: '80px',
    height: '20px',
    marginLeft: '200px'
  },
  login: {
    background: '#EF483E 0% 0% no-repeat padding-box',
    borderRadius: '23px',
    opacity: '1',
    width: '132px',
    height: '46px',
    color: 'white',
  },
  title: {
    justifycontent: 'flex-end',
  },
}));

const AppBars = (props) => {
  const classes = useStyles(props);
  const { image, title,button } = props.data;
  return (

    <div className={classes.Card}>
      <div className={classes.ImageCard}>
      </div>
      <Typography variant="h6" align="center" classes={{
        h6: classes.h6
      }}> {title}</Typography>
      <Button className={classes.login}>{button}</Button>
    </div>

  );
}

export default AppBars;

